Access_Matrix.sol.content:
pragma solidity ^0.5.16;


contract Access_matrix {
    mapping(string => mapping(address => uint8)) matrix;
    uint32 variable;

    function updateMatrix(string memory _activity, address _role, uint8 _val) public {
      matrix[_activity][_role] = _val;
    }

    function updateValue(uint32 _variable, string memory _activity) public {
        bool has_access = (matrix[_activity][msg.sender] >> 4 ) & 1 == 1;
        assert(has_access);
    }
}

